            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Les entreprises et les structures publiques ont besoin de se tenir au courant des 
                    différents changements économiques et numériques qui subsistent dans notre société. 
                    Ainsi la formation en Intelligence Economique & développement International (IEDI) aide 
                    les établissements, les organismes et même les pays à se préparer à d’éventuels changements 
                    et proposer une stratégie adéquate.
                </p>
           ");
            WriteLiteral(@" </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’intelligence économique est une discipline qui s’inscrit dans une demande de plus en 
                    plus importante de la part des entreprises et des organisations publiques d’adopter une 
                    stratégie d’intelligence économique en fonction de l’environnement économique et technologique 
                    grâce à une veille. Les étudiants sont amenés à comprendre et analyser les enjeux et les interactions 
                    mondiaux dans le but d’un développement international pour l’entreprise.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
      ");
            WriteLiteral(@"              Le Master IEDI propose une formation en gestion des informations, des connaissances et des compétences visant à 
                    accroitre l’efficacité des décisions et des actions des acteurs dans une économie de la connaissance mondialisée. 
                    Il est fondé sur le cycle entier de l’information : collecter, traiter, analyser, utiliser et protéger les informations 
                    pour être plus efficace. La formation met l’accent sur un nouveau mode de pensée à long terme fondé sur la prospective 
                    permettant d’intégrer l’incertitude et la complexité de l’économie. Il propose de même un nouveau mode d’action à court 
                    terme basé sur la pro-action qui utilise les différents outils 
                    de l’IE : travailler en réseau, élaborer des politiques d’influence et protéger les connaissances immatérielles.
                </p>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
              ");
            WriteLiteral(@"  <p class=""description""> 
                    Les masters en intelligence économique sont des diplômes de niveau bac+5 qu’il est possible de poursuivre après des études en Communication, Economie, Droit, Relations internationales, etc.
                    Le Master première année (M1) IEDI est donc une formation qui prolonge les enseignements dispensés en licence Sciences de l’information et de la communication, Relations internationales, Economie ou de Droit 
                    des affaires. Les connaissances et compétences visées dans le cadre de ce M1 sont d’ordre théorique et méthodologique.
                    Le master 1 s’adresse aux étudiants qui souhaitent à l’issue de la première année s’orienter soit :
                </p>
                <ul class=""one_list"">
                    <li> 
                        en Master 2 Consultant en Intelligence Economique
                    </li>
                    <li> 
                        en Master 2 Intelligence Economique & Stratégies inte");
